$('#area-of-study-tabs').on('collapse.zf.tabs', function() {
	$('.area-of-study-nav').removeClass('area-of-study-nav--blue-bg');
});

$('#area-of-study-tabs').on('change.zf.tabs', function() {
	$('.area-of-study-nav').addClass('area-of-study-nav--blue-bg');
});

$('#area-of-study-dropdown').on('show.zf.dropdown', function() {
	$('#area-of-study-tabs .is-active a').click();
	$('.area-of-study-nav').addClass('area-of-study-nav--blue-bg');
});

$('#area-of-study-dropdown').on('hide.zf.dropdown', function() {
	$('.area-of-study-nav').removeClass('area-of-study-nav--blue-bg');
});
function bgVideo() {

  enquire.register("screen and (min-width: 768px)", {

    match : function() {
    	$("#bgVideo").YTPlayer({
			onReady: function( player ) {
				jQuery('.header-video').prepend('<button class="togglePlay command pause">Pause Video</button>');

				jQuery('.togglePlay').click( function() {
					jQuery(this).toggleClass('play pause');

					// also toggle the text play/pause
					if (jQuery(this).hasClass('play')) {
						jQuery(this).text('Play Video');
					} else {
						jQuery(this).text('Pause Video');
					}

					jQuery('#bgVideo').YTPTogglePlay();
				});

			}
		});
    },
    unmatch : function() {
		jQuery('.header-video .togglePlay').remove();
    }

  });

}

bgVideo();

$('.short-profile__more').click( function(event) {
	event.preventDefault();
	$(this).toggleClass('open');
	$(this).prev().slideToggle();
});

$('.library-hours__more').click( function(event) {
	event.preventDefault();
	$(this).toggleClass('open');
	$(this).prev().toggleClass('open');
});

function cardRow() {
	$('.card-row .carousel').slick({
		infinite: true,
		slidesToShow: 3,
		variableWidth: true,
		arrows: true,
		responsive: [
			{
				breakpoint: 1200,
				settings: {
					slidesToShow: 2
				}
			},
			{
				breakpoint: 768,
				settings: {
					slidesToShow: 1,
					centerMode: true,
					dots: false
				}
			}
		]

	}).on('init', function(event, slick){
		$('.slick-current').next().next().addClass('next-next-active');
		$('.slick-current').next().addClass('next-active');
    }).on('beforeChange', function(event, slick, currentSlide, nextSlide){
        $('.slick-slide').removeClass('next-next-active next-active');    
    }).on('afterChange', function(event, slick, currentSlide, nextSlide){
		$('.slick-current').next().next().addClass('next-next-active');
		$('.slick-current').next().addClass('next-active');
    });
}

cardRow();

$('.card--statistic a').hover( function() {
	$(this).parents('.card--statistic').toggleClass('hover');
});

$('.card--news a').hover( function() {
	$(this).parents('.card--news').toggleClass('hover');
});

$('.more-content__read-more a').click( function(event) {
	event.preventDefault();
	$(this).parent('.read-more').parent('.more-content__read-more').prev('.more-content__collapsed-content').slideToggle('fast');
	if ($(this).text() == 'Read more +') {
		$(this).text('Read less -').attr('aria-expanded', 'true');
	} else {
		$(this).text('Read more +').attr('aria-expanded', 'false');
	}
});

$('.scholarship-link').hide();

function addUpCostLineItems() {
	$('.program-cost-category__amount').each( function() {
		var lineItems = $(this).parents("li.accordion-item:not('.hide')").find('.program-cost-line-item__amount');
		var costCategoryTotal = 0; 
		$.each( lineItems, function() {
			costCategoryTotal = costCategoryTotal + parseFloat($(this).attr('data-line-item'));
		});
		$(this).attr('data-cost-category', costCategoryTotal).text('$' + numberWithCommas(costCategoryTotal));
	});
}

addUpCostLineItems();

function addUpTotalCost() {
	$('.program-cost-option__total-amount').each( function() {
		var costCategories = $(this).parents('ul.accordion').find('.program-cost-category__amount');
		var costOptionTotal = 0;
		$.each( costCategories, function() {
			costOptionTotal = costOptionTotal + parseFloat($(this).attr('data-cost-category'));
		});
		$(this).attr('data-cost-option-total', costOptionTotal).text('$' + numberWithCommas(costOptionTotal));
	});
}

addUpTotalCost();

$('.program-cost-option__housing-option--commute').click(function(e) {
	e.preventDefault();
	$('.program-cost-option__housing-option').removeClass('active');
	$('.program-cost-option__housing-option--commute').addClass('active');
	$('.program-cost-option__housing-costs').addClass('hide');
	addUpCostLineItems();
	addUpTotalCost();
	estimatedCost();
});

$('.program-cost-option__housing-option--on-campus').click(function(e) {
	e.preventDefault();
	$('.program-cost-option__housing-option').removeClass('active');
	$('.program-cost-option__housing-option--on-campus').addClass('active');
	$('.program-cost-option__housing-costs').removeClass('hide');
	addUpCostLineItems();
	addUpTotalCost();
	estimatedCost();
});

$('input.gpa').bind('keyup', function() {
	var value = $(this).val();
	$('input.gpa').val(value).change();
});

function calcScholarshipOptional() {
	$('.program-cost__scholarship-calculator--optional').each( function() {
		var gpaField = $(this).find('.gpa');
		var gpa;
		var parentTabPanel = $(this).parents('.tabs-panel');
		var scholarship = parentTabPanel.find('.program-cost__scholarship-amount');
		var totalCost = parentTabPanel.find('.program-cost-option__total-amount').attr('data-cost-option-total');
		var estimatedCost = parentTabPanel.find('.program-cost-option__estimated-cost-amount')
		var scholarshipNone = parentTabPanel.find('.program-cost__scholarship-none');
		var scholarshipRank1 = parentTabPanel.find('.scholarships-by-rank_scholarship--rank1');
		var scholarshipRank2 = parentTabPanel.find('.scholarships-by-rank_scholarship--rank2');
		var scholarshipRank3 = parentTabPanel.find('.scholarships-by-rank_scholarship--rank3');
		var scholarshipRank4 = parentTabPanel.find('.scholarships-by-rank_scholarship--rank4');
		var scholarshipRank1Value = parseFloat(parentTabPanel.find('.scholarships-by-rank').attr('data-rank1-value'));
		var scholarshipRank2Value = parseFloat(parentTabPanel.find('.scholarships-by-rank').attr('data-rank2-value'));
		var scholarshipRank3Value = parseFloat(parentTabPanel.find('.scholarships-by-rank').attr('data-rank3-value'));
		var scholarshipRank4Value = parseFloat(parentTabPanel.find('.scholarships-by-rank').attr('data-rank4-value'));

		scholarshipNone.hide();
		scholarship.hide();
		scholarshipRank1.hide();
		scholarshipRank2.hide();
		scholarshipRank3.hide();
		scholarshipRank4.hide();

		$(this).find('input').bind('keyup change', function() {


			var totalCost = getTotalCost($(this));

			scholarshipNone.hide();
			scholarship.hide();
			scholarshipRank1.hide();
			scholarshipRank2.hide();
			scholarshipRank3.hide();
			scholarshipRank4.hide();
			totalCost = parentTabPanel.find('.program-cost-option__total-amount').attr('data-cost-option-total');

			gpa = parseFloat(gpaField.val());

			if (gpa >= 3.5) {
				scholarship.text('-' + numberWithCommas(scholarshipRank1Value));
				scholarship.attr('data-scholarship-amount', scholarshipRank1Value);
				estimatedCost.text('$' + numberWithCommas(parseFloat(totalCost) - scholarshipRank1Value));
				$('.scholarship-link').show();
				scholarshipRank1.show();
				scholarship.show();
			}

			else if (gpa >= 3.0) {
				scholarship.text('-' + numberWithCommas(scholarshipRank2Value));
				scholarship.attr('data-scholarship-amount', scholarshipRank2Value);
				estimatedCost.text('$' + numberWithCommas(parseFloat(totalCost) - scholarshipRank2Value));
			$('.scholarship-link').show();
				scholarshipRank2.show();
				scholarship.show();
			}

			else if (gpa >= 2.7) {
				scholarship.text('-' + numberWithCommas(scholarshipRank3Value));
				scholarship.attr('data-scholarship-amount', scholarshipRank3Value);
				estimatedCost.text('$' + numberWithCommas(parseFloat(totalCost) - scholarshipRank3Value));
				$('.scholarship-link').show();
				scholarshipRank3.show();
				scholarship.show();
			}

			else if (gpa >= 2.5) {
				if(isNaN(scholarshipRank4Value)) {
					scholarship.hide().text('');
					scholarship.attr('data-scholarship-amount', 0);
					scholarshipNone.show();
					estimatedCost.text('$' + numberWithCommas(parseFloat(totalCost)));

				} else {
					scholarship.text('-' + numberWithCommas(scholarshipRank4Value));
					scholarship.attr('data-scholarship-amount', scholarshipRank4Value);
					estimatedCost.text('$' + numberWithCommas(parseFloat(totalCost) - scholarshipRank4Value));
					$('.scholarship-link').show();
					scholarshipRank4.show();
					scholarship.show();
				}
			}

			else if (isNaN(gpa)) {
				scholarship.hide().text('');
				scholarship.attr('data-scholarship-amount', 0);
				estimatedCost.text('$' + numberWithCommas(parseFloat(totalCost)));
			}

			else {
				scholarship.hide().text('');
				scholarship.attr('data-scholarship-amount', 0);
				scholarshipNone.show();
				estimatedCost.text('$' + numberWithCommas(parseFloat(totalCost)));
			}

	    });
	});
}

calcScholarshipOptional();

function estimatedCost() {
	$('.program-cost-option__estimated-cost-amount').each( function() {
		var totalCost = $(this).parents('.tabs-panel').find('.program-cost-option__total-amount').attr('data-cost-option-total');
		var scholarship = $(this).parents('.tabs-panel').find('.program-cost__scholarship-amount').attr('data-scholarship-amount');

		if (scholarship) {
			var estimateCost = parseFloat(totalCost) - parseFloat(scholarship);
		}
		else {
			var estimateCost = parseFloat(totalCost);
		}
		$(this).text('$' + numberWithCommas(estimateCost));
	});
}

function getTotalCost(item) {
	return item.parents('.tabs-panel').find('.program-cost-option__total-amount').attr('data-cost-option-total');
}

estimatedCost();

function numberWithCommas(x) {
    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}

