if($('body').hasClass('section-events')) {

	var filters = window.location.search;
	var eventsPath = window.location.pathname.split('/');
	var eventsRangeContext = eventsPath[2];
	var eventsRangeValue = eventsPath[3];

	if (eventsRangeValue) {

		if (eventsRangeContext == 'week') {
			var month = moment(eventsRangeValue, "YYYYWW").format('YYYYMM');
			var day = moment(eventsRangeValue, "YYYYWW").format('YYYYMMDD');
			var week = eventsRangeValue;
		}

		else if (eventsRangeContext == 'day') {
			var month = moment(eventsRangeValue, "YYYYMMDD").format('YYYYMM');
			var week = moment(eventsRangeValue, "YYYYMMDD").format('YYYYWW');
			var day = eventsRangeValue;
		}

		else if (eventsRangeContext == 'month') {
			var week = moment(eventsRangeValue, "YYYYMM").format('YYYYWW');
			var day = moment(eventsRangeValue, "YYYYMM").format('YYYYMMDD');
			var month = eventsRangeValue;
		}

		$('#calendar-month-view-link').attr('href', '/events/month/' + month + filters);
		$('#calendar-week-view-link').attr('href', '/events/week/' + week + filters);
		$('#calendar-day-view-link').attr('href', '/events/day/' + day + filters);

	} else {
		$('#calendar-month-view-link').attr('href', '/events/month' + filters);
		$('#calendar-week-view-link').attr('href', '/events/week' + filters);
		$('#calendar-day-view-link').attr('href', '/events/day' + filters);
	}

	var viewTitle;

	if (eventsRangeContext == 'day') {
		viewTitle = moment($('.events-list__body').find('.view-header').find('h3.view-title').text()).format('ddd, MMMM D, YYYY')
	}
	else {
		viewTitle = $('.events-list__body').find('.view-header').find('h3.view-title').text();
	}

	$('.view-header').find('li.current-page').text(viewTitle);
}

