function removeDegreeOfferedProgramType(value) {
	var newValue = value
	.replace(/\/location\/[a-zA-Z0-9.\-_]*/i, '')
	.replace(/\/program-type\/[a-zA-Z0-9.\-_]*/i, '')
	.replace(/\/education-goals\/[a-zA-Z0-9.\-_]*/i, '')
	.replace(/\/teach-subject-level\/[a-zA-Z0-9.\-_]*/i, '')
	.replace(/\/education-where\/[a-zA-Z0-9.\-_]*/i, '')
	.replace(/\/education-location\/[a-zA-Z0-9.\-_]*/i, '')
	.replace(/\/location_by_school\/[a-zA-Z0-9.\-_]*/i, '')
	.replace(/\/education_goals_by_school\/[a-zA-Z0-9.\-_]*/i, '')
	.replace(/\/education_teach_by_teach\/[a-zA-Z0-9.\-_]*/i, '')
	.replace(/\/education_where_teach_by_school\/[a-zA-Z0-9.\-_]*/i, '')
	.replace(/\/education_where_study_by_school\/[a-zA-Z0-9.\-_]*/i, '');

	return newValue;
}

