function gallery() {
	$('.gallery--row .media-items').each( function() {
		$(this).not('.slick-initialized').slick({
			infinite: true,
			slidesToShow: 2,
			responsive: [
				{
					breakpoint: 767,
					settings: {
						slidesToShow: 1
					}
				}
			]
		});
	});

	$('.gallery--full-width .media-items').addClass('hello-world').each( function() {
		$(this).not('.slick-initialized').slick({
			infinite: false,
			adaptiveHeight: true
		});
	}).on('afterChange', function(event, slick, currentSlide, nextSlide){
		setTimeout(function() {
			$( window ).resize();
		}, 2000);
	});

	$('.launch-gallery__content').each( function() {

		$(this).on('lity:ready', function(event, instance) {
			$(this).find('.media-items').not('.slick-initialized').each( function() {
				$(this).slick({
					infinite: true
				});
			});
		});
	});

	$('.gallery__placeholder-slide').height($('.gallery__placeholder-slide').next().find('.slick-current .field-media--image').height());

	var resizeListener;
	var pause = 500;

	$( window ).resize(function() {
		clearTimeout(resizeListener);
		resizeListener = setTimeout(function(){
			$('.gallery__placeholder-slide').height($('.gallery__placeholder-slide').next().find('.slick-current .field-media--image').height());
		},pause);
	});
}

